"original": |2-
     The IPP object is refusing to service the request because the
     Document data cannot be decompressed when using the algorithm
     specified by the "compression" operation attribute.  This error is
     returned independent of the Client-supplied "ipp-attribute-fidelity"
     attribute.  The Printer MUST return this status-code, even if there
     are Job Template attributes that are not supported as well, since
     this error is a bigger problem than with Job Template attributes.
     See Sections 4.1.7 and 4.2.1.1.
"fixed": |-
  The IPP object is refusing to service the request because the Document data cannot be decompressed when using the algorithm specified by the "compression" operation attribute.  This error is returned independent of the Client-supplied "ipp-attribute-fidelity" attribute.  The Printer MUST return this status-code, even if there are Job Template attributes that are not supported as well, since this error is a bigger problem than with Job Template attributes. See Sections 4.1.7 and 4.2.1.1.
"ko": |-
  "압축" 작업 속성에 지정된 알고리즘을 사용할 때 문서 데이터의 압축을 풀 수 없기 때문에 IPP 개체가 요청 서비스를 거부하고 있습니다. 이 오류는 클라이언트 제공 "ipp-attribute-fidelity" 속성과 관계없이 반환됩니다. 프린터는 지원되지 않는 작업 템플릿 속성이 있더라도 이 상태 코드를 반환해야 합니다. 이 오류는 작업 템플릿 속성보다 더 큰 문제이기 때문입니다. 섹션 4.1.7 및 4.2.1.1을 참조하십시오.
